import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
// import App from "./App";
import * as serviceWorker from "./serviceWorker";
import SimpleProps from "./Components/SimpleProps";
ReactDOM.render(<SimpleProps />, document.getElementById("root"));
